Can you solve the following math problem? In circle $J$, $HO$ and $HN$ are tangent to the circle at $O$ and $N$. Find the number of degrees in the sum of $m\angle J$ and $m\angle H$. [asy]
size(150);
import graph;
pair J = (0,0), H = (6,0), O, N;
path circ = Circle(J,3);
pair M = midpoint(J--H);
path secCirc = Circle(M,3);
pair[] tangentPoints = intersectionpoints(circ,secCirc);
O = tangentPoints[0]; N = tangentPoints[1];
draw(J--N--H--O--cycle);
draw(circ);
label("$H$",H,E);
label("$J$",J,W);
label("$N$",N,S);
label("$O$",O,NE);
[/asy] Please reason step by step, and put your final answer within \boxed{{}}. To solve the problem, we need to find the sum of the measures of angles \( \angle J \) and \( \angle H \) in the given geometric configuration. Let's break down the problem step by step.

1. **Identify the given information:**
   - \( HO \) and \( HN \) are tangent to circle \( J \) at points \( O \) and \( N \), respectively.
   - \( J \) is the center of the circle.
   - \( H \) is a point outside the circle.

2. **Understand the properties of tangents:**
   - A tangent to a circle is perpendicular to the radius at the point of tangency.
   - Therefore, \( \angle HOJ = 90^\circ \) and \( \angle HNJ = 90^\circ \).

3. **Analyze the quadrilateral \( HONJ \):**
   - \( HONJ \) is a quadrilateral with two right angles at \( O \) and \( N \).
   - The sum of the interior angles of any quadrilateral is \( 360^\circ \).

4. **Calculate the sum of the angles in \( HONJ \):**
   \[
   \angle HOJ + \angle HNJ + \angle J + \angle H = 360^\circ
   \]
   Substituting the known values:
   \[
   90^\circ + 90^\circ + \angle J + \angle H = 360^\circ
   \]
   Simplify the equation:
   \[
   180^\circ + \angle J + \angle H = 360^\circ
   \]

5. **Solve for the sum of \( \angle J \) and \( \angle H \):**
   \[
   \angle J + \angle H = 360^\circ - 180^\circ
   \]
   \[
   \angle J + \angle H = 180^\circ
   \]

Therefore, the number of degrees in the sum of \( m\angle J \) and \( m\angle H \) is \(\boxed{180}\).

question:
